import React from "react";

function Footer() {
  return (
    <footer className="bg-gray-800 text-white text-center py-4 mt-10">
      <p>&copy; {new Date().getFullYear()} Kognivue. All rights reserved.</p>
    </footer>
  );
}

export default Footer;
